import React from "react";
// import "./style.css";

function SearchResults(props) {
  return (


        <tbody>
          {/* <li  key={props.first} className="list-group-item"> */}
          <td src="{props.image}">{props.image}</td>
          <td>{props.first}</td>
          <td>{props.last}</td>
          <td>{props.email}</td>
          <td>{props.phone}</td>
          <td>{props.dob}</td>
        </tbody>


  );
}

export default SearchResults;
